import React from "react";
import { Routes, Route } from "react-router-dom";
import Form from "./Form";
import Summary from "./Summary";
import './App.css';

const App = () => {
  return (
    <Router>
      <div className="App">
        <Routes>
          <Route path="/" element={<Form />} />
          <Route path="/summary" element={<Summary />} />
        </Routes>
      </div>
    </Router>
  );
};

export default App;
